import React, { useRef } from "react";
import TopNavBar from "../../components/TopNavBar/TopNavBar";
import styles from "./LandingPage.module.css";

import {
	ButtonContentData,
	cardContainerData,
	cardContainerData2,
	carouselDataContent,
	Logos,
} from "./data";
import { Link } from "react-router-dom";
import {
	HEADER_CONTENT,
	HEADER_CONTENT_2,
	HEADER_CONTENT_3,
	LEADING_ORGANIZATIONS_TITLE,
	PARAGRAPH_CONTENT,
	PARAGRAPH_CONTENT_2,
	PARAGRAPH_CONTENT_3,
	SECURITY_AND_IT_HEADER_CONTENT,
	SECURITY_AND_IT_SUB_CONTENT,
	HEADER_CONTENT_4,
	CAROUSEL_HEADER_CONTENT_1,
	CAROUSEL_SUB_HEADER_CONTENT_1,
	CAROUSEL_PARAGRAPH_CONTENT_1,

} from "../../utils/cms";
import image1 from "../../assets/images/image1.png";
import CardComponent from "../../components/Card/CardComponent";
import FeaturesCardComponent from "../../components/Card/FeaturesCardComponent";
import SignUpForm from "../SignUpFormik/SignUpForm";
import Footer from "../../components/Footer/Footer";
import avatarImage from "../../assets/images/avatar.png";
import Slider from "react-slick";
import "./slick.css";
import "./slick-theme.css";

import bgImage from "../../assets/images/carouselbg.png";
import { AiOutlineRight, AiOutlineLeft } from 'react-icons/ai';

type arrowDataType = {
    onClick?: () => void;
};


const PrevArrow = (props) => {
	const { className, onClick } = props;
	return (
	  <div className={className} onClick={onClick}>
		<i className="fa fa-chevron-left" />
	  </div>
	);
  };

  const NextArrow = (props) => {
	const { className, onClick } = props;
	return (
	  <div className={className} onClick={onClick}>
		<i className="fa fa-chevron-right" />
	  </div>
	);
  };
function LandingPage() {
	const settings = {
		dots: true,
		infinite: true,
        arrow: true,

		speed: 100,
		slidesToShow: 1,
		slidesToScroll: 1,
		nextArrow: <NextArrow /> ,
        prevArrow: <PrevArrow /> ,
	};
	const slider = useRef();

	return (
		<>
			<TopNavBar />

			<div className={styles.container}>
				<div className={styles.headerContent}>{HEADER_CONTENT}</div>
				<div className={styles.paragraphContent}>
					{PARAGRAPH_CONTENT}
				</div>
				<div className={styles.button}>
					{ButtonContentData.map((ele, i) => {
						return (
							<Link
								to={ele.path}
								className={
									ele.type === "button1"
										? styles.buttonText1
										: styles.buttonText2
								}
							>
								{ele.name}
							</Link>
						);
					})}
				</div>
				<div className={styles.imageSection}>
					<img src={image1} alt="" />
				</div>
				<div className={styles.headerContent2}>
					{LEADING_ORGANIZATIONS_TITLE}
				</div>
				<div className={styles.logosSection}>
					{Logos.map((ele) => {
						return (
							<img
								className={styles.imageSection2}
								src={ele.image}
								alt=""
							/>
						);
					})}
				</div>

				{/* <div className={styles.carouselContent}>
					<img src={bgImage} alt="" />

					<div className={styles.carouselContainer}>
						<Slider {...settings}>
							<div>1</div>
							<div>2</div>

							<div className={styles.contains}>
								<div>
									<img src={avatarImage} alt="" />
								</div>
								<div
									className={
										styles.carouselContentSection
									}
								>
									<div
										className={
											styles.carouselHeader
										}
									>
										{CAROUSEL_HEADER_CONTENT_1}
									</div>
									<div
										className={
											styles.carouselSubHeader
										}
									>
										{
											CAROUSEL_SUB_HEADER_CONTENT_1
										}
									</div>
									<div
										className={
											styles.carouselParagraphContent
										}
									>
										{CAROUSEL_PARAGRAPH_CONTENT_1}
									</div>
								</div>
							</div>
						</Slider>
					</div>
				</div> */}

				<div className={styles.headerContent}>
					{HEADER_CONTENT_2}
				</div>

				<div className={styles.paragraphContent}>
					{PARAGRAPH_CONTENT_2}
				</div>

				<div className={styles.carouselSlider}>
				<Slider {...settings}>
				{
					carouselDataContent.map((ele,i)=>
					{
						return (
							<div className={styles.carouselVisibility}>
							<div className={styles.carouselContentSection2}>
								<div className={styles.carouselHeaderContent}>
								{ele.header}
								</div>
								<div className={styles.carouselsubHeaderContent}>
								{ele.subHeader}
								</div>
							</div>
							<img  src={ele.image} alt=""/>

				</div>
						)
					})
				}




				</Slider>
				</div>

				<div className={styles.contentSection}>
					<div className={styles.titleContent}>
						{SECURITY_AND_IT_HEADER_CONTENT}{" "}
					</div>
					<div className={styles.titleSubContent}>
						{SECURITY_AND_IT_SUB_CONTENT}
					</div>

					<div className={styles.cardContentSection}>
						{cardContainerData.map((ele, i) => {
							return (
								<CardComponent
									image={ele.image}
									heading={ele.heading}
									subHeading={ele.subHeading}
								/>
							);
						})}
					</div>
					<div className={styles.button}>
						<Link
							className={styles.buttonContentSection}
							to="/getStarted"
						>
							GET STARTED
						</Link>
					</div>
				</div>

				<div className={styles.contentSection2}>
					<div className={styles.headerContent}>
						{HEADER_CONTENT_3}
					</div>
					<div className={styles.paragraphContent}>
						{PARAGRAPH_CONTENT_3}
					</div>
					<div className={styles.cardContentSection}>
						{cardContainerData2.map((ele, i) => {
							return (
								<FeaturesCardComponent
									id={ele.id}
									heading={ele.heading}
									subHeading={ele.subHeading}
									featuresText={ele.featuresText}
									features={ele.features}
									buttonText={ele.buttonText}
									path={"/signup"}
								/>
							);
						})}
					</div>
				</div>
			</div>
			<div className={styles.signupFormContent}>
				<div className={styles.headerContent}>
					{HEADER_CONTENT_4}
				</div>
				<div className={styles.signUpForm}>
					<SignUpForm />
				</div>
			</div>

			<Footer />
		</>
	);
}

export default LandingPage;
